●カサつきがちな唇にも美しくフィット。縦ジワが目立たずふっくらした印象に仕上げます。<br><br>
●つややかな美しい発色とうるおい感が続きます。<br><br>
●たっぷりついて、明るくクリアな色がムラなく均一に唇にのります。<br><br>
●乾燥から唇を守る保湿成分配合※です。
 <br><br><br>
